import React from 'react';
import axios from 'axios';

const About = ({ students, onDelete }) => {
    const handleEdit = (id) => {
        // Implement edit functionality here
        console.log('Edit student with id:', id);
    };

    const handleDelete = async (id) => {
        // Implement delete functionality here
        try {
            const response = await axios.delete(`http://127.0.0.1:8000/api/student/${id}/`);
            console.log('Data deleted:', response.data);
            // Call onDelete to update the state and remove the deleted student from the list
            onDelete(id);
        } catch (error) {
            console.error('Error deleting data:', error);
        }
    };

    return (
        <div className="App">
            <h1>Connection between React and Django</h1>
            {students.map((student) => (
                <div key={student.id}>
                    <h3>{student.studname} - {student.email}</h3>
                    <button onClick={() => handleEdit(student.id)}>Edit</button>
                    <button onClick={() => handleDelete(student.id)}>Delete</button>
                </div>
            ))}
        </div>
    );
};

export default About;
